import React from 'react';
import Algorithms from '../components/Algorithms';


class AlgorithmsList extends React.Component {
    state = {
        value: 1,
      };

    render() {
        const radioStyle = {
            display: 'block',
            height: '30px',
            lineHeight: '30px',
        };

        return (
            <Algorithms/>
        )
    }
}

export default AlgorithmsList;
